import React from 'react';
import './Online.css';


const Online = ({user}) => {
    return (
        <li className="rightbarFriend">
        <div className="rightbarProfileImgContainer">
         <img src="assets/person/fatima.jpg" alt="" className="rightbarProfileImg" />
         <span className="rightbarOnline"></span>
        </div>
        <span className="rightbarUsername">Fatima Fati</span>
     </li>
    );
}

export default Online;
